import React from 'react';
import Modal from '../Modal';

const StreamDelete = () => {

    const actions = (
        <div>
            <button className="ui button negative">DELETE</button>
        </div>
    )

    return(
        <div>
            StreamDelete
            <Modal 
                title="DELETE STREAM"
                content="정말 지우시겠습니까??"
            />
        </div>
    )
}

export default StreamDelete
